何度もイラストと見比べて、そっくりになる様、試行錯誤を重ねた結果、ついに熊本県より利用許諾をいただきました～！！<br>
親しみある顔☆　ポーンと前にでたおなか♪<br>
身長6ｃｍのボリューム感♪ホビックスよりお届けいたします。
<br><br>
◆ホビータイム：約180分<br>
◆サイズ：約4cmｘ6cm<br>
◆用意するもの：ハサミ<br>
◆承諾番号：くまモン＃11771
