<font color="red">防災・防犯</font>ホイッスルをオシャレに持ち歩こう。<br>
簡単なペヨーテステッチで初心者の方でもお作りいただけます。<br>
ストラップパーツを外してチェーンやコードをつければネックレス・ペンダントとしてもお使いいただけます。<br>
大切な方へのプレゼントにもおすすめです。<br><br>

■仕上りサイズ／約4.0cm（ホイッスルを含む本体部分）<br>
■制作時間：90分程度<br>
■別途必要なもの：はさみ、ビーズステッチ用針（12号等）が必要です。<br><br>

